const click_img = document.querySelector(".click_img")
const your_coin = document.querySelector(".your_coin")
const trophy = document.querySelector(".trophy")
const trophy_image = document.querySelector(".trophy_image")
const rank = document.querySelector(".rank")

let fixedNumber = 0
let coinNumber = 0
click_img.addEventListener("click", function () {
    if (coinNumber >= 0 && coinNumber <= 1) {
        incrementbytwentyqepik()
    }
    if (coinNumber >= 1 && coinNumber <= 5) {
        click_img.innerHTML = `
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRIf9lT5mgsfdjQ0qPKq2TUPfZEIt9rlkbEVQ&s">
        `
        rank.innerHTML = `
       <img class="trophy_image" src="https://www.trophiesandmedals.com/%40%40content/pub/image_17633/055.jpg">
            <p class="trophy">silver</p>
       `
        incrementbyfiftyqepik()
    }
    if (coinNumber >= 5 && coinNumber <= 15) {
        click_img.innerHTML = `
        <img src="data:image/jpeg;base64,">
        `
        rank.innerHTML = `
        <img class="trophy_image" src="https://t3.ftcdn.net/jpg/06/11/28/20/360_F_611282071_cE7tx2pOtZGGF6t7Rnfh3uFBsUDghzmW.jpg">
             <p class="trophy">gold</p>
        `
        incrementbyonemanat();
    }
    if (coinNumber >= 15) {
        click_img.innerHTML = `
    <img class="trophy_image" src="data:image/jpeg;base64,">
    `
        rank.innerHTML = `
        <img class="trophy_image" src="https://5.imimg.com/data5/SELLER/Default/2023/6/313213652/CG/GR/GI/53176106/diamond-trophy.jpg">
             <p class="trophy">diamond</p>
        `
        incrementbyfivemanat();
    }

})



function incrementbytwentyqepik() {
    coinNumber = coinNumber + 0.2;
    fixedNumber = coinNumber.toFixed(2)
    your_coin.innerHTML = `${fixedNumber}`
}



function incrementbyfiftyqepik() {
    coinNumber = coinNumber + 0.5;
    fixedNumber = coinNumber.toFixed(2)
    your_coin.innerHTML = `${fixedNumber}`
}

function incrementbyonemanat() {
    coinNumber = coinNumber + 1;
    fixedNumber = coinNumber.toFixed(2)
    your_coin.innerHTML = `${fixedNumber}`
}


function incrementbyfivemanat() {
    coinNumber = coinNumber + 5;
    fixedNumber = coinNumber.toFixed(2)
    your_coin.innerHTML = `${fixedNumber}`
}